import React from 'react';
import {View, Image, Text} from 'react-native'
import styles from './styles';



const SingleProductEditScreen=(props)=>{
    const product=props.navigation.getParam('product')
    console.log('props in edit page : ',product)
    return (
        <View style={styles.container}>
            <Image style={styles.photo} source={{ uri: product.photo_url }} />

            <Text>
                {product.title}
            </Text>
            {
                product.photosArray.length>0? (
                    product.photosArray.map(url=>{
                        return <Image style={styles.photo} source={{ uri: url }} />
                    })
                ):null
            }
        </View>
    )
}

export default SingleProductEditScreen
